@nightyScript(
    name="UI Background",
    author="nes",
    description="Change your background on the UI. Inspired by cpores :D", 
    usage="UI Script"
)
def UIBackgroundChanger():
    main_ui.load_css('body { background: transparent !important; }')
    os.makedirs(f'{getScriptsPath()}/scriptData', exist_ok=True)
    script_config_path = f"{getScriptsPath()}/scriptData/uiBackgroundChanger.json"

    def updateSetting(key, value):
        settings = json.load(open(script_config_path, 'r', encoding="utf-8", errors="ignore")) if os.path.exists(script_config_path) else {}
        settings[key] = value
        json.dump(settings, open(script_config_path, 'w', encoding="utf-8", errors="ignore"), indent=2)

    def getSetting(key=None):
        if os.path.exists(script_config_path):
            with open(script_config_path, 'r', encoding="utf-8", errors="ignore") as f:
                settings = json.load(f)
            return settings.get(key) if key else settings
        return None if key else {}

    if getSetting("background"):
        changeUIBackground(getSetting("background"), getSetting("pattern"))

    def applyNewBg():
        updateSetting("background", ubc_bg_input.value)
        updateSetting("pattern", ubc_pattern_toggle.checked)
        changeUIBackground(ubc_bg_input.value, pattern=ubc_pattern_toggle.checked)
        ubc_tab.toast(type="SUCCESS", title="Applied", description="New background style applied.")

    def resetBg():
        updateSetting("background", None)
        updateSetting("pattern", None)
        resetUIBackground()
        ubc_tab.toast(type="SUCCESS", title="Reset", description="Reverted background style back to original.")

    ubc_tab = Tab(name="UI Background", title="UI Background Changer", icon="palette")
    ubc_container = ubc_tab.create_container(type="rows")
    ubc_card = ubc_container.create_card(height="auto", width="auto", gap=3)
    ubc_card.create_ui_element(UI.Text, content="Change the UI background image to your own, this script is not guaranteed to work for future updates.", size="sm", weight="bold")
    ubc_group = ubc_card.create_group(
        type="columns",
        gap=3,
        full_width=True
    )
    ubc_bg_input = ubc_group.create_ui_element(UI.Input, label="Background Image URL", required=True, full_width=True)
    ubc_pattern_toggle = ubc_group.create_ui_element(UI.Toggle, label="Enable pattern", checked=getSetting("pattern") or True)
    ubc_apply_btn = ubc_card.create_ui_element(UI.Button, label="Apply Changes",size="md", variant="cta", onClick=applyNewBg, full_width=True)
    ubc_reset_btn = ubc_card.create_ui_element(UI.Button, label="Reset Background",size="md", color="danger", onClick=resetBg, full_width=True)

    ubc_tab.render()

UIBackgroundChanger()
